import React, { useEffect, useState } from 'react';
import { Calendar, Filter, Search } from 'lucide-react';
import { useNavigate } from 'react-router-dom';
import { getAllCharities } from '../../../services/charityApi';

const CampaignsView = () => {
  const navigate = useNavigate();
  const [charities, setCharities] = useState([]);
  const [selectedCategory, setSelectedCategory] = useState('All');
  const [searchQuery, setSearchQuery] = useState('');

  useEffect(() => {
    getAllCharities(0).then(res => {
      const data = Array.isArray(res)
        ? res
        : (res.result && Array.isArray(res.result.data) ? res.result.data : []);
      setCharities(data);
      console.log('charities response:', data);
    });
  }, []);

  // Filter charities based on category and search query
  const categories = ['All', ...new Set(charities.map(charity => charity.org_dns_url || 'Other'))];
  const filteredCharities = charities.filter(charity => {
    const matchesCategory = selectedCategory === 'All' || (charity.org_dns_url || 'Other') === selectedCategory;
    const matchesSearch = charity.org_name.toLowerCase().includes(searchQuery.toLowerCase()) ||
      (charity.org_email && charity.org_email.toLowerCase().includes(searchQuery.toLowerCase()));
    return matchesCategory && matchesSearch;
  });

  const handleCharityClick = (orgId) => {
    // You can navigate to a charity detail page or do something else here
    // navigate(`/charities/${orgId}`);
  };

  return (
    <div className="p-8 bg-gradient-to-br from-slate-50 via-purple-50 to-pink-50 min-h-screen">
      {/* Header */}
      <div className="mb-8">
        <h1 className="text-3xl font-bold text-gray-900 mb-2">Charity</h1>
        <p className="text-gray-600">View and manage all active charities</p>
      </div>

      {/* Filters */}
      <div className="mb-8 flex items-center gap-4 flex-wrap">
        <div className="flex items-center gap-2">
          <Filter size={20} className="text-gray-500" />
          <span className="text-gray-700 font-medium">Category:</span>
          <select
            className="w-48 px-4 py-2 bg-white border border-gray-200 rounded-xl shadow-sm hover:shadow-md transition-shadow focus:ring-2 focus:ring-purple-500 focus:border-transparent"
            value={selectedCategory}
            onChange={(e) => setSelectedCategory(e.target.value)}
          >
            {categories.map(category => (
              <option key={category} value={category}>{category}</option>
            ))}
          </select>
        </div>

        <div className="flex items-center gap-2 ml-8">
          <Search size={20} className="text-gray-500" />
          <input
            type="text"
            placeholder="Search charities..."
            className="w-64 px-4 py-2 bg-white border border-gray-200 rounded-xl shadow-sm hover:shadow-md transition-shadow focus:ring-2 focus:ring-purple-500 focus:border-transparent"
            value={searchQuery}
            onChange={(e) => setSearchQuery(e.target.value)}
          />
        </div>
      </div>

      {/* Charities Table */}
      <div className="bg-white rounded-xl shadow-sm overflow-hidden">
        <div className="overflow-x-auto">
          <table className="w-full">
            <thead className="bg-gray-50">
              <tr>
                <th className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase tracking-wider">Charities</th>
                <th className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase tracking-wider">Logo</th>
                <th className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase tracking-wider">Email</th>
                <th className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase tracking-wider">Website</th>
              </tr>
            </thead>
            <tbody className="bg-white divide-y divide-gray-200">
              {filteredCharities.map((charity) => (
                <tr
                  key={charity.org_id}
                  className="hover:bg-gray-50 cursor-pointer transition-colors"
                  onClick={() => handleCharityClick(charity.org_id)}
                >
                  <td className="px-6 py-4 whitespace-nowrap">
                    <div className="text-sm font-medium text-gray-900">{charity.org_name}</div>
                  </td>
                  <td className="px-6 py-4 whitespace-nowrap">
                    {charity.org_img_url && (
                      <img src={charity.org_img_url} alt={charity.org_name} className="h-10 w-10 object-contain rounded" />
                    )}
                  </td>
                  <td className="px-6 py-4 whitespace-nowrap">
                    <div className="text-sm text-gray-900">{charity.org_email}</div>
                  </td>
                  <td className="px-6 py-4 whitespace-nowrap">
                    <a
                      href={charity.org_dns_url.startsWith('http') ? charity.org_dns_url : `https://${charity.org_dns_url}`}
                      target="_blank"
                      rel="noopener noreferrer"
                      className="text-purple-600 hover:underline"
                    >
                      {charity.org_dns_url}
                    </a>
                  </td>
                </tr>
              ))}
            </tbody>
          </table>
        </div>
      </div>
    </div>
  );
};

export default CampaignsView;
